import React from 'react';

function ListeningStats({ totalMinutes, topGenre }) {
  return (
    <div className="listening-stats">
      <h2>Your Listening Stats</h2>
      <p>Total Minutes: {totalMinutes}</p>
      <p>Top Genre: {topGenre}</p>
    </div>
  );
}

export default ListeningStats;
